import React from "react";

function Home() {
  return (
    <div className="">
      <h1>ChallengeQuest</h1>
      <p>
        Welcome to our challenge quest website, where you embark on exciting
        journeys towards your goals! Are you ready to take on a challenge and
        push your limits? Whether you're aiming to improve your fitness, develop
        new habits, or conquer personal milestones, our platform is here to
        support you every step of the way.
      </p>
    </div>
  );
}

export default Home;
